import React from 'react';
import Sdata  from './Sdata';
import Movie from './Movie';
const Bookmovie = () =>
{
    //const [total,setTotal] = useState(0)
    //const InputEvent=(props)=>{};
    function ncard(val)
    {
        <Movie 
        imgsrc= {val.imgsrc}
        moviecat={val.moviecat}
        movietitle={val.movietitle}
        />;
    };
    return <>
    Sdata.map(ncard)
    </>
       
} ;
export default Bookmovie;
